import React from 'react';

const TableHeader = ({data}) => {
    const tableColumns = data.columns;
    const tableRows = data.rows;
   
    return (
    <div>
    <h1>React Table</h1>;
    <thead>
        <tr>
            {tableColumns.map((column) => { return
            <th>{column}</th>; })}
        </tr>
    </thead>
</div>
    ) 
};
export default TableHeader;
